    useEffect(()=>{
        const fetchData = async () =>{
            axios("https://api.giphy.com/v1/gifs/trending",{
                params: {
                    api_key: '8XSfFaxsjpau64kyGOWNRfhqcYIwH5qp'
                }
            });
        }
    })

    return <div className="">Giphy</div>
}

